column67:
The current Handbook website is maintained by a third-party Contractor who provides the following services (including but not limited to the following):

publishing, consolidating and updating content on the FCA Handbook website;

ongoing development and technical support to improve the design and/or usability of the website, based on user feedback;

providing management information to the FCA to enable them to monitor the service;

providing Handbook content to licensees who have an agreement with the FCA that they can use the Handbook material; and

offering a print subscription service (or similar) for subscribed users.

The scope of this tender is to secure the services of a successful bidder to create, host, maintain and manage the FCA Handbook solution and provide a range of supporting services to replace the existing services.
